import React from 'react';
import { Link } from 'react-router-dom';

function Sidebar() {
  return (
    <aside className="w-64 bg-gray-100 dark:bg-gray-900 p-4 shadow-lg sticky top-0 h-full">
      <h2 className="text-xl font-bold mb-4 text-blue-600 dark:text-blue-300">üìç Explore</h2>
      <input type="text" placeholder="Search location" className="w-full mb-2 px-3 py-2 border rounded dark:bg-gray-800 dark:text-white" />
      <input type="date" className="w-full mb-2 px-3 py-2 border rounded dark:bg-gray-800 dark:text-white" />
      <select className="w-full mb-4 px-3 py-2 border rounded dark:bg-gray-800 dark:text-white">
        <option>Sort by Price</option>
        <option>Sort by Model</option>
      </select>

      <nav className="flex flex-col gap-3">
        <Link to="/book" className="text-blue-500 hover:underline">Book a Bike</Link>
        <Link to="/rent" className="text-blue-500 hover:underline">Rent Your Bike</Link>
        <Link to="/profile" className="text-blue-500 hover:underline">Profile</Link>
      </nav>
    </aside>
  );
}

export default Sidebar;
